  return(
    <>
      <h1>Name: {props.name}</h1>
    </>
  )
}

const App = () => {
  // This need to be out of the return
  const name = 'Jenny';
  return (
    <div className="App">
      <h1>Hello! {1-1}</h1>
      {name ? (
        <>
          <Person name={name}/>
        </>
      ):(
        <>
          <h1>The is no name.</h1>
        </>
      )}
    </div>
  );
}

export default App;
